    printf("    /=========\\        __  __                        /_/    _\n");
    printf("    /  *   *  \\        \\ \\/ /        /\\  /\\    __ _  ____  | |\n");
    printf("  i/ O   i   O \\i       \\  /   __   /  \\/  \\  / _` |/ ___\\ |_|\n");
    printf("  /=============\\       /  \\  |__| / /\\  /\\ \\| (_| |\\___ \\  _\n");
    printf("  /  O   i   O  \\      /_/\\_\\      \\ \\ \\/ / / \\__,_|\\____/ |_|\n");
    printf("i/ *   O   O   * \\i\n");
    printf("/=================\\\n");
